// src/modules/sku/SkuSearchResults.js

import React from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import ModelsCard from '../models/ModelsCard';
import modelsData from '../models/models.json';
import './SkuSearch.css';

const SkuSearchResults = ({ onSelectModel }) => {
  const { sku } = useParams();
  const navigate = useNavigate();

  const filteredModels = modelsData.models.filter(model => 
    typeof model.sku === 'string' && model.sku.toLowerCase().includes(sku.toLowerCase())
  );

  if (filteredModels.length === 0) {
    return <div>No models found for SKU: {sku}</div>;
  }

  const handleSelectModel = (selectedModel) => {
    navigate(`/cross-reference/sku/${selectedModel.id}/alternatives`);
    onSelectModel(selectedModel);
  };

  return (
    <div className="container-fluid mb-5">
      <div className="row">
        <h3>Search Results for SKU: {sku}</h3>
      </div>
      <div className="row d-flex flex-wrap p-2">
        {filteredModels.map(model => (
          <ModelsCard
            key={model.id}
            model={model}
            isActive={false}
            onSelect={() => handleSelectModel(model)}
          />
        ))}
      </div>
    </div>
  );
};

export default SkuSearchResults;
